    public static String decompress(String str) throws IOException {
        if (str == null || str.isEmpty())
            return str;

        GZIPInputStream gis = new GZIPInputStream(new ByteArrayInputStream(Base64.getDecoder().decode(str)));
        ByteArrayOutputStream out = new ByteArrayOutputStream();
        byte[] buffer = new byte[256];
        int n;
        while ((n = gis.read(buffer)) >= 0) {
            out.write(buffer, 0, n);
        }

        return out.toString();
    }

    public static void leXML(String xml) {
        try {

            DocumentBuilder db = DocumentBuilderFactory.newInstance().newDocumentBuilder();
            InputSource is = new InputSource();
            is.setCharacterStream(new StringReader(xml));
            Document document = db.parse(is);

            // Obter o elemento raiz
            Element root = document.getDocumentElement();

            // Obter os valores dos elementos
            String tpAmb = root.getElementsByTagName("tpAmb").item(0).getTextContent();
            String verAplic = root.getElementsByTagName("verAplic").item(0).getTextContent();
            String cStat = root.getElementsByTagName("cStat").item(0).getTextContent();
            String xMotivo = root.getElementsByTagName("xMotivo").item(0).getTextContent();
            String dhResp = root.getElementsByTagName("dhResp").item(0).getTextContent();
            String ultNSU = root.getElementsByTagName("ultNSU").item(0).getTextContent();
            String maxNSU = root.getElementsByTagName("maxNSU").item(0).getTextContent();

            // Exibir os valores
            System.out.println("tpAmb: " + tpAmb);
            System.out.println("verAplic: " + verAplic);
            System.out.println("cStat: " + cStat);
            System.out.println("xMotivo: " + xMotivo);
            System.out.println("dhResp: " + dhResp);
            System.out.println("ultNSU: " + ultNSU);
            System.out.println("maxNSU: " + maxNSU);

            // Obter os valores dos elementos dentro de loteDistDFeInt
            NodeList nodeList = root.getElementsByTagName("docZip");
            for (int i = 0; i < nodeList.getLength(); i++) {
                Element element = (Element) nodeList.item(i);
                String NSU = element.getAttribute("NSU");
                String schema = element.getAttribute("schema");
                String value = element.getTextContent();

                String xmlNode = decompress(value);

                System.out.println("NSU: " + NSU + ", schema: " + schema + ", value: " + xmlNode);

            }

        } catch (Exception e) {
            e.printStackTrace();
        }
    }

